import React from 'react';
import {Select} from './styles';

function SelectComponent(props) {
  const {
    id,
    name,
    value,
  } = props; 
  return (
      <Select name={name} id={id}>
        <option value={value}>{value}</option>
      </Select>
  );
}
export default SelectComponent;

